window.bookSummaryJSON = "<p>O'Hara never wanted to be a hero. He was a combat pilot only because his skills made him the best and Earth needed men like him to fight the enemy among the stars.&nbsp;</p> <p>Living a life a service and duty, alone in a cockpit suited him well, but fate had other plans for him. Shot down over an alien planet he was saved by a beautiful and mysterious woman named Katreena.&nbsp;&nbsp;</p> <p>He soon learns that the world is populated by people who seemed to have been lost by time and controlled by stones that the people believe to be divine magic.&nbsp;&nbsp;</p> <p>Wanting only to return to his fleet, he discovers that he has more than a passing connection with the world's people, a love that resurrects a heart long thought dead, and a decisive battle to the war that followed him.</p>"; 
